SET FOREIGN_KEY_CHECKS=0;

DROP DATABASE IF EXISTS `sails-test`;

CREATE DATABASE `sails-test`
    CHARACTER SET 'utf8'
    COLLATE 'utf8_general_ci';

USE `sails-test`;

#
# Structure for the `album` table : 
#

CREATE TABLE `album` (
  `eventName` varchar(255) DEFAULT NULL,
  `eventDate` varchar(255) DEFAULT NULL,
  `creator` varchar(255) DEFAULT NULL,
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `createdAt` datetime DEFAULT NULL,
  `updatedAt` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=21 DEFAULT CHARSET=latin1;

#
# Structure for the `careerleader` table : 
#

CREATE TABLE `careerleader` (
  `name` varchar(255) DEFAULT NULL,
  `photo` varchar(255) DEFAULT NULL,
  `department` varchar(255) DEFAULT NULL,
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `createdAt` datetime DEFAULT NULL,
  `updatedAt` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

#
# Structure for the `news` table : 
#

CREATE TABLE `news` (
  `name` varchar(255) DEFAULT NULL,
  `text` longtext,
  `creator` varchar(255) DEFAULT NULL,
  `image` longtext,
  `isHeader` tinyint(1) DEFAULT NULL,
  `headlines` varchar(160) DEFAULT NULL,
  `category` int(11) DEFAULT NULL,
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `createdAt` datetime DEFAULT NULL,
  `updatedAt` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=13 DEFAULT CHARSET=latin1;

#
# Structure for the `newscategory` table : 
#

CREATE TABLE `newscategory` (
  `name` varchar(255) DEFAULT NULL,
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `createdAt` datetime DEFAULT NULL,
  `updatedAt` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

#
# Structure for the `photo` table : 
#

CREATE TABLE `photo` (
  `photo` longtext,
  `album` int(11) DEFAULT NULL,
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `createdAt` datetime DEFAULT NULL,
  `updatedAt` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=latin1;

