INSERT INTO `news` (`name`, `text`, `creator`, `image`, `isHeader`, `headlines`, `category`, `id`, `createdAt`, `updatedAt`) VALUES 
  ('        ',' &nbsp; &nbsp; &nbsp; &nbsp;','Desconocido','data:image/jpeg;base64,',1,'      ',NULL,1,'2017-02-19 01:14:06','2017-02-19 01:21:12'),
  ('Centro Rector de la carrera Ingeniera Informtica en Cuba','<span style=\"font-family:''Times New Roman'';font-size:medium;\">La carrera de Ingenier&iacute;a Inform&aacute;tica de la CUJAE es rectora de estos estudios desde que surgi&oacute; en 1977, habiendo contribuido en forma significativa en relaci&oacute;n con los centros hom&oacute;logos de todo el pa&iacute;s. Durante el 2002 su claustro prepar&oacute; los materiales acad&eacute;micos necesarios para fundar ese mismo a&ntilde;o la Universidad de Ciencias Inform&aacute;ticas (UCI) con la derivaci&oacute;n de la carrera denominada Ingenier&iacute;a en Ciencias Inform&aacute;ticas.</span>','Desconocido','data:image/jpeg;base64,',1,'Centro Rector de la carrera Ingeniera Informtica en Cuba desde su inicio en 1977, facilitador de la apertura de la carrera en todas las universidades de Cub',NULL,8,'2017-02-15 21:58:09','2017-02-16 00:08:20'),
  ('Carrera acreditada De Excelencia','<span style=\"font-family:''Times New Roman'';font-size:medium;\">La Junta de Acreditaci&oacute;n Nacional ha acreditado la carrera con la categor&iacute;a&nbsp;</span><strong>De Excelencia</strong><span style=\"font-family:''Times New Roman'';font-size:medium;\">&nbsp;en enero de 2005 y junio de 2012. La Universidad Tecnol&oacute;gica de La Habana &ldquo;Jos&eacute; Antonio Echeverr&iacute;a&rdquo; a que pertenece tambi&eacute;n fue acreditada&nbsp;</span><strong>De Excelencia</strong><span style=\"font-family:''Times New Roman'';font-size:medium;\">&nbsp;en el 2017 teniendo en cuenta, en parte, los resultados de nuestra Facultad.</span>','Desconocido','data:image/jpeg;base64,',1,'Carrera acreditada De Excelencia desde el 2005 cuando se inici el proceso en Cuba.',NULL,9,'2017-02-15 22:00:09','2017-02-16 00:08:30'),
  ('Formacin posgraduada de reconocido prestigio internacional','<span style=\"font-family:''Times New Roman'';font-size:medium;\">La formaci&oacute;n posgraduada ha estado presente desde los inicios de la carrera. En 1991 se cre&oacute; el Centro Regional para el Entrenamiento de Profesores de Ingenier&iacute;a y Arquitectura (CREPIAI). En 1994 se inici&oacute; la Maestr&iacute;a en Inform&aacute;tica Aplicada que por sus resultados mereci&oacute; el Premio de la Asociaci&oacute;n Universitaria Iberoamericana de Postgrado (AUIP) en el 2001 y se encuentra acreditada&nbsp;</span><strong>De Excelencia&nbsp;</strong><span style=\"font-family:''Times New Roman'';font-size:medium;\">desde el 2017 por la Junta de Acreditaci&oacute;n Nacional. Actualmente la maestr&iacute;a est&aacute; generalizada en todo el pa&iacute;s y se imparti&oacute; en pa&iacute;ses latinoamericanos como Bolivia y Venezuela. En el 2014 se inici&oacute; el Doctorado en Ciencias y Tecnolog&iacute;as Inform&aacute;ticas que se abri&oacute; tambi&eacute;n en la Rep&uacute;blica Bolivariana de Venezuela.</span>','Desconocido','data:image/jpeg;base64,',1,'Maestra de Informtica Aplicada creada en 1994, abarcando toda Cuba y algunos pases latinoamericanos, con Premio AUIP 2001 y acreditada De Excelencia en el',NULL,10,'2017-02-15 22:01:20','2017-02-16 00:09:20'),
  ('Proyectos cientficos estudiantiles de xito','<span style=\"font-family:''Times New Roman'';font-size:medium;\">Por sus resultados acad&eacute;micos y cient&iacute;ficos el CEIS obtuvo en varias ocasiones la condici&oacute;n de Destacado y Vanguardia Nacional entre los a&ntilde;os 1999 y 2003. El CEIS y luego la Facultad cuentan en su haber varios proyectos&nbsp;</span><span style=\"font-family:''Times New Roman'';font-size:medium;\">cient&iacute;ficos estudiantiles de &eacute;xito que se encuentran hasta el d&iacute;a de hoy generalizados&nbsp;</span><span style=\"font-family:''Times New Roman'';font-size:medium;\">en todo el pa&iacute;s, entre los que se destacan: el Sistema para la Gesti&oacute;n de los Recursos Humanos (GREHU), el Sistema para la Gesti&oacute;n de la Nueva Universidad (SIGENU) y el Sistema para el la asistencia del Trabajo Operativo y Pericial de la Criminal&iacute;stica cubana (STOP-Crim). Para potenciar la formaci&oacute;n de profesionales y soluci&oacute;n de problemas en las esferas de la seguridad y orden interior, en el 2006 se cre&oacute; la Unidad Docente de Inform&aacute;tica Operativa (UDIO) donde los profesores y estudiantes de la carrera tuvieron una importante participaci&oacute;n. Por los excelentes resultados obtenidos se ampli&oacute; su organizaci&oacute;n mediante la creaci&oacute;n del Complejo de Investigaciones Tecnol&oacute;gicas Integradas (CITI) dentro de la CUJAE. En la actualidad el CITI es uno de los centros insignias del pa&iacute;s en estas importantes esferas.</span>','Desconocido','data:image/jpeg;base64,',1,'Existen varios resultados aplicados en todo el pas con buena valoracin de los usuarios, entre ellos: GREHU, SIGENU y STOP-Crim.',NULL,11,'2017-02-15 22:01:50','2017-02-16 00:09:35'),
  ('Inician los Juegos Deportivos 13 de Marzo ','<span style=\"font-family:''Times New Roman'';font-size:medium;\">Los Juegos Deportivos &ldquo;13 de marzo&rdquo; de la CUJAE est&aacute;n a punto de comenzar. Nuestra Facultad necesita de ti para tener buenos resultados. Puedes participar en varias modalidades deportivas, apoyar a tus compa&ntilde;eros en las competencias o simplemente ayudarlos para que no pierdan el contenido de otras actividades. Para los trabajadores las competencias comienzan el 20 de febrero, la inauguraci&oacute;n ser&aacute; a las 10 AM en la piscina de la CUJAE. Los estudiantes comienzan el mismo 13 de marzo. Busca al capit&aacute;n de tu deporte preferido y,&nbsp;</span><span style=\"font-family:Liberation Serif, serif;\">&iexcl;</span><span style=\"font-family:''Times New Roman'';font-size:medium;\">ap&uacute;ntate ya!</span>','Desconocido','data:image/jpeg;base64,',1,'Comienza la fiesta deportiva de la CUJAE en el 2017, el 20 de febrero para los trabajadores y el 13 de marzo para los estudiantes.',NULL,12,'2017-02-15 22:02:33','2017-02-16 00:08:57');

COMMIT;

